		<div className="drawerStories">
			<ul>
				<li><Link className="sizePad" to='/canon'>{/*<Icon  size={30} iconName="books"/>*/}canon</Link></li>
				<li><Link className="sizePad" to='/legends'>{/*<Icon size={30} iconName="circuit"/>*/}legends</Link></li>
			</ul>
		</div>
);
}
